  use eBar;
  
  declare @counter int;
  DECLARE @geo as GEOGRAPHY
  set @counter = 1;
  declare @restaurantId int;
  
  while (@counter <= 100)
  BEGIN
    --insert restaurant
	select @restaurantId=SCOPE_IDENTITY();

	set @geo = geography::STGeomFromText('POINT(' + cast(23.799422 as nvarchar(15)) + ' ' + cast(44.318144 as nvarchar(15)) +')',4326);
	DECLARE @r float,@t float, @w float, @x float, @y float, @u float, @v float;

	SET @u=RAND();
	SET @v=RAND();

	--8046m = ~ 5 miles
	SET @r= 8046/(111300*1.0);
	SET @w = @r * sqrt(@u);
	SET @t = 2 * PI() * @v;
	SET @x = @w * cos(@t);
	SET @y = @w * sin(@t);
	SET @x = @x / cos(@geo.Lat);
	
	--insert rest location
	values('Craiova',CAST(@geo.Lat+@x AS decimal(10,6)), CAST(@geo.Long+@x AS decimal(10,6)),@restaurantId, concat('Strada Test ',@counter), 'Dolj');
			
